import React, { useState } from 'react';
import axios from 'axios';
import { 
    Card, 
    CardContent,
    Paper,
    Button,
    Typography
} from '@material-ui/core';
const styles = {
    paper: {
        width: "20rem", padding: "1rem"
    },
    input: {
        marginBottom: "1rem"
    },
    button: {
        width: "100%"
    }
}

export default () => {
    return (
        <Card>
            <CardContent>
                <Paper>
                    <Typography>
                        Welcome! You must login to use this service...
                    </Typography>
                </Paper>
            </CardContent>
        </Card>
    )
}
